     render() {
       return (
         <View style={style.container}>
           <Text>ShoppingCart</Text>

         </View>
       );
     }

}

export default Cart;

const AppStackNavigator = createStackNavigator({
  
})

const styles =StyleSheet.create({
  container: {
    flex: 1,
